import { login } from '../../../utils/api'
import { 
  LOGIN,
  ACCESS_TOKEN
} from '../../../utils/constants'

export const loginUser = (user, history) => dispatch => {
  return login(user).then( token => {
    localStorage.setItem(ACCESS_TOKEN, token);
    history.push("/createProject")
    dispatch({
      type: LOGIN,
    })
    return true
  }).catch( error => {
    console.log("error")
  })
}
